const hostApi = process.env.NODE_ENV === "development"
    ? "http://localhost"
    : "http://eqviumjs.herokuapp.com";
const portApi = process.env.NODE_ENV === "development" ? 80 : "";
const baseURLApi = `${hostApi}${portApi ? `:${portApi}` : ``}/api`;
const redirectUrl = process.env.NODE_ENV === "development" ? "http://localhost:3000" : "http://eqviumjs.herokuapp.com";

export default {
  hostApi,
  portApi,
  baseURLApi,
  redirectUrl,
  remote: "http://eqviumjs.herokuapp.com",
  isBackend: process.env.REACT_APP_BACKEND,
  auth: {
    email: "admin@flatlogic.com",
    password: "password"
  }
};
